#Start of classes
Class SWobject {
            
        [string]$Name
        [int]$Id


        #[ValidateSet('JSON','Wookiee')]
        [SWEncoding] $Encoding# = 'JSON' # 

        #[ValidateSet('people','planets','species','starships','vehicles','films')]
        [SWobjectType]$Type

        hidden [string]$Filter

        hidden [System.Management.Automation.PSCredential]$Credentials
        #Method ShowSchema
            #        [switch]$Schema,

        hidden $BaseUrl = 'http://swapi.co/api/'
        hidden $Data
        hidden $Schema
        
        #constructors

        swobject(){
        }

        SWobject([int]$Id,[SWobjectType]$Type){
            $this.id = $Id
            $this.Type = $Type
        }

        SWobject([string]$Name,[SWobjectType]$Type){
            if ($this.Encoding -eq 'wookie'){
                throw "Wookies don't understand PowerShell name filtering. Please use the ID instead. Waarrghaaa!"
            }
            $this.Name = $Name
            $this.Type = $Type
        }

        #Methods

        

        Get(){
            write-debug $this
            if (!($this.Type)){
                
                throw 'Cannot continue without assigning a type. Please assign a type, and retry again.'
            }

            if ($this.name -eq $null -and $this.id -eq $null){
                throw 'Specify at least and ID or a Name parameter'
            }else{
            
                #$BaseUrl = 'http://swapi.co/api/'
                $Return = @()
                $Dataraw = ''
                if ($this.id){

                    
                    $Url = $this.BaseUrl + $this.Type + 's' + '/' + $this.id 
                    
                    write-verbose 'returning information'
                    Write-debug "Invoking rest: $($url)"
                    $Dataraw = Invoke-RestMethod -Method Get -uri $Url
                    $this.Data = $Dataraw
                    #$this.Data = $return


                }elseif ($this.name){
                    
                    #$this.Data = Invoke-RestMethod -Method Get -Uri $Url #-Credential $Credentials
                }else{
                    $Url = $this.BaseUrl + $this.Type + 's' + '/' 
                    $Dataraw = Invoke-RestMethod -Method Get -uri $Url
                    $return += $Dataraw.results
                    Write-Verbose "Found $($DataRaw.Count) entries."
                     while ($Dataraw.Data.next){
                        write-verbose 'Information, there is a lot. Patient, you will be...'
                        $Dataraw = Invoke-RestMethod -Method Get -uri $Dataraw.next
                        $return += $Dataraw.results
                     }

                     $this.Data = $return
                     
                }
            
            }
        }

        GetSchema(){
            
            $Url = $this.BaseUrl + $this.Type + 's' + '/' + 'schema'
            
            write-verbose 'returning information'
            Write-debug "Invoking rest: $($url)"

            $this.Schema = Invoke-RestMethod -Method Get -Uri $Url #-Credential $Credentials

            #return $this.Schema
        }


}

Class SWPeople : SWObject{

    #Properties
        [String]$Name
        [int]$Id
        [int]$Height
        [int]$Mass
        [String]$HairColor
        [String]$SkinColor
        [String]$BirthYear
        [String]$Gender
        [String]$Homeworld
        

    #Constructors

        SWPeople(){
            
            $this.Type = [SWObjectType]::people
        }

        SWPeople([int]$id){
        
            $Type = [SWobjectType]::people
            $Url = $this.BaseUrl + $Type + '/' + $id + '/' 
            $Dataraw = Invoke-RestMethod -Method Get -uri $Url

            $this.Name = $Dataraw.Name
            $this.id = $id
            $this.Height = $Dataraw.height
            $this.Mass = $Dataraw.mass
            $this.HairColor = $Dataraw.hair_color
            $this.SkinColor = $Dataraw.skin_color
            $this.BirthYear = $Dataraw.birth_year
            $This.Gender = $Dataraw.gender
            $This.Homeworld = $Dataraw.Homeworld

        }

        SWPeople([object]$Row) {
            
            
            
            if ($Row -eq $null -or $Row -eq '' ){
                throw 'The Row parameter cannot be empty.'
            }else{
                
            }            
            write-verbose "Creating new People object: '$($Row.Name)'" 
                
                $Type = [SWobjectType]::people

                $this.Name = $Row.Name
                $this.id = $Row.url.split('/')[-2]

                if ($row.height -ne "unknown"){
                    $this.Height = $Row.height
                }
                
                if ($row.Mass -ne "unknown"){
                    $this.Mass = $Row.Mass
                }

                
                $this.HairColor = $Row.hair_color
                $this.SkinColor = $Row.skin_color
                $this.BirthYear = $Row.birth_year
                $This.Gender = $Row.gender
                $This.Homeworld = $Row.Homeworld            
                
                
        
        }
    
    #Methods

        [SWPeople[]]static GetAll(){
            
        [string]$BaseUrl = 'http://swapi.co/api/' #Had to hardcode this value since it cannot access $this in a static method.
        $Type = [swobjectType]::People

        #For some reason using a regular array never worked :(
        $Peoples = New-Object System.Collections.ArrayList
        $Url = $BaseUrl + $Type + '/' 
            $Dataraw = Invoke-RestMethod -Method Get -uri $Url
            
            while ($Dataraw.next){                   
                write-verbose 'Hacking R2-D2 for information...'
                $AllResults = $Dataraw.results #($Dataraw.Content | convertfrom-Json).results
                
                foreach ($Row in $AllResults){
                    #Create New Instance
                    
                    $People = [SWPeople]::new([object]$Row)
                    $Peoples.add($People)
                }

                $DataRaw = Invoke-RestMethod -Method Get -uri $Dataraw.next
            }

                return $Peoples
    }

